INSERT INTO `coverage` VALUES (11,'Liability coverage','Auto liability coverage is mandatory. This includes Bodily injury liability and Property damage liability',200.00,50000.00),(12,'Uninsured and underinsured motorist coverage','Covers medical bills or repairs to your vehicle if you are hit by a driver who does not have insurance or an underinsured driver',100.00,50000.00),(13,'Comprehensive coverage','Covers damage to your car from things like theft, fire, hail or vandalism. It may pay to repair or replace your vehicle.',150.00,10000.00),(14,'Collision coverage','Covers accident with another vehicle, or if you hit an object such as a fence. It may pay to repair or replace your vehicle',100.00,20000.00),(15,'Medical payments coverage','If you, your passengers or family members who are driving the insured vehicle are injured in an accident, it may pays costs associated with the injuries',500.00,500000.00),(21,'Home coverage','Protects homes against loss or damage caused due to theft, fire, or natural & manmade disasters',200.00,50000.00),(22,'Commercial coverage','Covers business units, shops, factories, warehouses, etc. Financial losses caused to commercial properties due to natural disasters are also covered',5000.00,3000000.00),(23,'Renters coverage','Covers loss or damages caused to the property by tenants. Electronic appliances, furniture, fittings, and other expensive installations are also covered',50.00,10000.00),(24,'Fire coverage','Protects properties against losses or damages caused due to fire. This plan covers fire accidents caused due to explosions, implosions, and lightning',1000.00,1000000.00),(25,'Public liability coverage','Protects property owners against the losses or damages caused within their property and losses caused to customers. Used on commercial properties such as restaurants and hotels',2000.00,2000000.00);
