CREATE DEFINER=`root`@`localhost` PROCEDURE `update_customer`(id INT, f_name VARCHAR(50), l_name VARCHAR(50), gen CHAR(1), social CHAR(11), birth DATE, emailc VARCHAR(100))
BEGIN
	DECLARE customer_exists INT;
    DECLARE email_exists INT;
	DECLARE idc INT;
    SET customer_exists = (SELECT COUNT(*) FROM insurance.customer WHERE id = customer_id);
    IF customer_exists > 0 THEN
		SET email_exists = (SELECT COUNT(*) FROM insurance.customer WHERE emailc = email AND id <> customer_id);
		IF email_exists = 0 THEN
			UPDATE insurance.customer SET first_name = f_name, last_name = l_name, gender = gen, ssn = social, dob = birth, email = emailc WHERE customer_id = id;
			SET idc = id;
        ELSE
			SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Unable to update: email already exists for another customer';
        END IF;
    ELSE
		SIGNAL SQLSTATE '45000'
		SET MESSAGE_TEXT = 'Unable to update: customer id does not exist';
    END IF;
    SELECT idc;
    END ;;
